import React from 'react';

class Navbar extends React.Component {
  renderProductSearch(){
    return(
      <section className="product-search-box">
        <input className="product-search form-control" placeholder="Search"/>
      </section>
    );
  }

  renderLogo() {
    return (
      <section>
        <img src="data:image/jpeg;base64," className="brand-logo"/>
      </section>
    );
  }

  renderUser() {
    return (
      <section className="right-side">
        <a href="#" className="login-btn">Login</a>
      </section>
    );
  }

  renderToggleNav() {
    return (
      <section className="navbar navbar-default">
        <div className="container-fluid">
          <div className="navbar-header"> 
            <button type="button" className="navbar-toggle collapsed" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1" aria-expanded="false">
              <span className="sr-only">Toggle navigation</span>
              <span className="icon-bar"></span>
              <span className="icon-bar"></span>
              <span className="icon-bar"></span>
            </button>
            <a className="navbar-brand" href="#">{this.renderLogo()}</a>
          </div>         
          <div className="collapse navbar-collapse" id="bs-example-navbar-collapse-1">
            <ul className="nav navbar-nav navbar-right">
              <li className="nav-list-item">{this.renderUser()}</li>
              <li className="nav-list-search">{this.renderProductSearch()}</li>
            </ul>  
          </div>
        </div>           
      </section>
    )
  }

  render(){
    return (
      <section>
        {this.renderToggleNav()} 
      </section>
    );
  }
}

export default Navbar;